import React from "react";

export default function Time(){
    let samay = new Date();
    let day = samay.getDay();
    let date = samay.getDate();
    let month = samay.getMonth();
    let year = samay.getFullYear();
    let timestamp = day+" "+date+" "+(month+1)+" "+year;
    return timestamp;
}
